import React, { useEffect, useState } from 'react'
import './dashboard.css'
import axios from 'axios'

const Details = () => {
    const [data ,setdata] = useState(null);
    const fetchdata = async() =>{
      const {data} = await axios.get("/api")
   
      setdata(data)
    }
   
    useEffect(() =>{
         fetchdata()
    }, [])
  return (
      <div className="box">
          {data?.map((data)=>{
              console.log(data)
              return (
                <>
                  <div className="box1">
                    <h3 className="box1-head">{data.tittle}</h3>
                    <span className="box1-end">{
                      data.progress === "pass"?  <Badge variant='solid' colorScheme='green'>
                      passed
                    </Badge>:<></>
                    }</span>
                     <span className="box1-end">{
                      data.progress === "denied"?  <Badge variant='solid' colorScheme='red'>
                      failed
                    </Badge>:<></>
                    }</span>
                     <span className="box1-end">{
                      data.progress === "pending"?  <Badge variant='solid' >
                      passed
                    </Badge>:<></>
                    }</span>
                  </div>
                  <hr />
                  <p className="box1-status">status</p>
                </>
              );
          })}
      </div>
 
  )
}

export default Details
